import React from 'react';
import './App.css';

const image_urls = ["https://pbs.twimg.com/media/BkHApMCCUAAyDjz.jpg:large"]


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>視力回復！ 日めくりカレンダー</h1>
        <h2> 3月15日 </h2>
        <img src={image_urls[0]} />
        <p>
        </p>

        <bottun>カレンダーをめくる</bottun>
      </header>
    </div>
  );
}

export default App;
